    false,nt"url": null,nt"notes": "This narrative report for Bear River Migratory
    Bird Refuge outlines Refuge accomplishments from January through April of 1962.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, furbearers, predators, rodents, mammals, raptors, fish,
    reptiles, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, and prescribed
    burning. Resource management is outlined; topics include fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
